You can configure a Matrix account in your config.json by adding a new field to the "profiles" object. For example, if you had two different accounts on your homeserver: { "profiles": { "admin": { "user_id": "@user1:example.com", "url": "https://example.com" }, "user": { "user_id": "@user2:example.com", "url": "https://example.com" } }, "default_profile": "user"
} With the "default_profile" field set, iamb will default to using the user profile at startup. You can manually specify what you want via the -P flag. For example: $ iamb -P admin
Logging in for @user1:example.com...
